import ExpenseItem from './components/Expenses/ExpenseItem.js';

function App(){
    let expenseDate = new Date(2023, 6, 24);
    let expenseTitle = "School Fee";
    let expenseAmount = 300;
    return (
     <div>
        <ExpenseItem date={expenseDate} title={expenseTitle} amount={expenseAmount}/>
     </div>
);
}

export default App;
